import Foundation

print("数据结构与算法之美!")


func lengthOfLongestSubstring(_ s: String) -> Int {
    // 存储字符串当前的字符所对应的子串长度
    var subMap = [Character: Int]()
    // 左指针
    var i = 0
    // 最大长度
    var maxLength = 0
    for (j, ch) in s.enumerated() {
        // 有重复字符出现，则跳过 subMap[ch] 的长度
        if subMap[ch] != nil {
            i = max(subMap[ch]!, i)
        }
        
        // 获取当前子串的最大长度
        maxLength = max(maxLength, j - i + 1)
        // 记录当前字符对应的长度
        subMap[ch] = j + 1
    }
    return maxLength
}

